const Scrollload = require('Scrollload').default */
import LazyLoad from 'react-lazyload';
import zhCN from 'antd/lib/locale/zh_CN';
import moment from 'moment';
import 'moment/locale/zh-cn';
import { AudioOutlined } from '@ant-design/icons';
import { UserOutlined } from '@ant-design/icons';
import { MessageOutlined, LikeOutlined, StarOutlined } from '@ant-design/icons';
import ListCont from "./ListCont"
import ListCont2 from "./ListCont2"
import Password from 'antd/lib/input/Password';
const { Meta } = Card;
const { Search } = Input;
const { Option } = Select;
const { TabPane } = Tabs;


class Homelogin extends React.Component{
    constructor(props){
       super(props)
       this.state={
           username:"",
           password:""
       }
    }
    inputChange=(e)=>{
        this.setState({
            username:e.target.value
        })
    }
    inputChange2=(e)=>{
        this.setState({
            password:e.target.value
        })
    }
    Logincon = () => {

        let _this = this
        window.window.uyun.env = 'prod';
        window.window.uyun.api.authenticateMobileUser('17596576465', 'wangbo1358', function (err, result1) {
          window.window.uyun.util.setToken(result1.token);
        });
      }

    render(){
        return(
            <div className="login_content">
                <Card
                className="login_content_card"
                    hoverable
                >
                    <sapn className="login_title">登陆</sapn>
                    <div className="login_top">
                        <span>请输入账号：</span>
                        <Input className="username" onChange={this.inputChange}  placeholder="请输入用户名" prefix={<UserOutlined />} />
                    </div>
                    <div className="login_bottom">
                        <span>请输入密码：</span>
                        <Input.Password className="password" onChange={this.inputChange2}  placeholder="请输入您的密码" />
                    </div>
                    <Button onClick={()=>{this.Logincon()}} className="login_btn" type="primary">登陆</Button>

                </Card>
            </div>
        )
    }
}

export default Homelogin
